import React from 'react';

const Internships = () => {
    return (
        <section id="internships" className="min-h-screen flex flex-col items-center justify-center bg-white">
            <h2 className="text-4xl font-bold mb-8">Internships</h2>
            <p className="text-lg text-center max-w-2xl">
                We offer internships for students to gain hands-on experience in full-stack development. Join us to enhance your learning with practical projects and industry exposure.
            </p>
        </section>
    );
}

export default Internships;
